description:
Thrilling! Dark! Sexy!

Federal agents Dana Scully (Kimberly Kane) and Fox Mulder (Anthony Rosano) are
sent to investigate a series of mysterious homicides. A common thread of the
murders are the occult images and symbols found at the scene of each crime
With time against them, Scully and Mulder must solve the riddle that will
eventually lead them to someone or something they have never encountered before. The truth is out that 'The Sex Files: A Dark XXX Parody' is the hottest movie
of the year! Suspenseful, sexy, awesome! Digital Sin presents a Revolution X film, 'The Sex Files: A Dark XXX Parody' featuring Kimberly Kane, Anthony Rosano, Ashlynn Brooke, Audrey Bitoni Evan Stone, Charley Chase, and more!

